import React from "react";
const Test = () => {
  const [thingsArr, setThingArr] = React.useState(["Thing 1 ", " Thing 2 "]);
  function add() {
    setThingArr((prevArr) => {
      return [...prevArr, `${""}Thing ${""}${prevArr.length + 1}`];
    });
  }
  return (
    <div>
      <button onClick={add} className="add">
        Add Things
      </button>
      <h1>{thingsArr}</h1>
    </div>
  );
};

export default Test;
